import React from 'react';
import './Form.css';

const Main = () => {
  return (
    <div className="form-container">
      <h1>메인 페이지</h1>
      <div className="button-container">
        <button onClick={() => console.log('로그인 버튼 클릭')}>로그인</button>
        <button onClick={() => console.log('회원가입 버튼 클릭')}>회원가입</button>
      </div>
    </div>
  );
};

export default Main;
